window.bookSummaryJSON = "<p>Artificial Condition is the follow-up to Martha Wells's Hugo, Nebula, Alex, and Locus Award-winning, New York Times bestselling All Systems Red.</p> <p>It has a dark past—one in which a number of humans were killed. A past that caused it to christen itself “Murderbot”. But it has only vague memories of the massacre that spawned that title, and it wants to know more.</p> <p>Teaming up with a Research Transport vessel named ART (you don’t want to know what the “A” stands for), Murderbot heads to the mining facility where it went rogue.</p> <p>What it discovers will forever change the way it thinks…</p> <p>Performed by David Cui Cui, Elena Anderson, Alejandro Ruiz, Bradley Foster Smith, Carolyn Kashner, Eric Messner, Jeri Marshall, Ken Jackson, Marni Penning, Michael John Casey, Rayner Gabriel, Scott McCormick, Shanta Parasuraman and Yasmin Tuazon.</p>"; 
